  }));
};

UilDocumentInfo.propTypes = {
  color: PropTypes.string,
  size: PropTypes.oneOfType([PropTypes.string, PropTypes.number]),
};

UilDocumentInfo.defaultProps = {
  color: 'currentColor',
  size: '24',
};

export default UilDocumentInfo;
